import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Header from './Components/Header';
import Produtos from './Components/Produtos';
import Footer from './Components/Footer';

const App = () => {
  return (
    <BrowserRouter>
      <Header />
      <Routes>
        <Route path="/" element={<Produtos />} />
      </Routes>
      <Footer />
    </BrowserRouter>
  );
};

export default App;
